pragma solidity ^0.8.10;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";

import "./ForTheLolzItem.sol";

/*
 * The ForSale Contract is basically a register of available tokens that is not yet
 * indexed by Exchanges.
 * Tokens are bought from the 'collections' instead of this one
 * and minted directly buy the initial buyer.
 * This contract is essentially keeping track of:
 * 1) how many copies of an artwork exist and are still available
 * 2) how much a copy costs
 * 3) to which collection it belongs
 */

contract ForTheLolzForSale is Ownable, ERC721, ERC721URIStorage, ERC721Enumerable {
  /* map forSaleTokenId to the collection it belongs to */
  mapping(uint256 => ForTheLolzItem) internal forSaleTokenIdToCollection;
  /* map forSaleTokenId to the tokenId to be used within that collection */
  mapping(uint256 => uint256)        internal forSaleTokenIdToCollectionTokenId;
  /* track number of forSaleTokenIds to mint with incremental tokenIds */
  uint256 totalNumberOfForSaleTokenId;

  mapping(uint256 => uint256) internal tokenPrice;
  mapping(uint256 => uint256) internal available;

  /* keep track of how many copies are within a specific collection.
   * we use this to keep track of the correct tokenId to be used for
   * that specific collection. */
  mapping(ForTheLolzItem => uint256) internal totalNumberOfAllCopies;

  /* keep track how many copies each artwork has */
  uint256[] internal totalNumberOfAtworks;

  /* mapping to check if a collection was added to be used by this contract */
  mapping(ForTheLolzItem => bool) internal ERC721Collections;
  /* array of collections to be returned to the frontend for visualization */
  ForTheLolzItem[] internal collections;

  constructor() ERC721("ForTheLolz", "FTL")  {
    totalNumberOfForSaleTokenId = 0;
  }

  /* onlyOwner */
  function addCollection(ForTheLolzItem collection) onlyOwner public {
    require(ERC721Collections[collection] == false, "collection was already added");
    ERC721Collections[collection] = true;
    totalNumberOfAllCopies[collection] = 0;
    collections.push(collection);
  }

  function removeCollection(ForTheLolzItem collection) onlyOwner public {
    require(ERC721Collections[collection], "collection needs to exist");
    delete ERC721Collections[collection];
    for (uint i=0; i<collections.length; i++) {
      if (collections[i] == collection) {
        delete collections[i];
        return;
      }
    }
  }

  /* views */
  function getTokenPrice(uint256 tokenId) public view returns (uint) {
    return tokenPrice[tokenId];
  }

  function getAvailableNumberOfArtworks(uint256 tokenId) public view returns (uint256) {
    return available[tokenId];
  }

  function getTotalNumberOfArtworks() public view returns (uint256[] memory) {
    return totalNumberOfAtworks;
  }

  /* getCollectionTokenId is called by the collection to traverse
   * the forSaleTokenId to the tokenId for the specific collection to be used */
  function getCollectionTokenId(uint256 tokenId) public view returns (uint256) {
    require(
      ERC721Collections[ForTheLolzItem(payable(msg.sender))],
      "should only be called by collection");
    require(
      forSaleTokenIdToCollection[tokenId] == ForTheLolzItem(payable(msg.sender)),
      "should be called by correct collection");
    return forSaleTokenIdToCollectionTokenId[tokenId];
  }

  /* getCollectionOfTokenId returns the collection for a given tokenId */
  function getCollectionOfTokenId(uint256 tokenId) public view returns (ForTheLolzItem) {
    return forSaleTokenIdToCollection[tokenId];
  }

  function getCollections() public view returns (ForTheLolzItem[] memory) {
    return collections;
  }

  /* public */
  function addItem(
    ForTheLolzItem collection, string memory newTokenURI, uint price, uint256 copies
  ) onlyOwner public {
    require(ERC721Collections[collection], "should be for a valid collection");
    /* mint to own address for bookkeeping only
     * (to use ERC721Enumerable for easy visualization & ERC721URIStorage to set a tokenURI) */
    _mint(address(this), totalNumberOfForSaleTokenId);

    tokenPrice[totalNumberOfForSaleTokenId] = price;
    available[totalNumberOfForSaleTokenId] = copies;
    _setTokenURI(totalNumberOfForSaleTokenId, newTokenURI);

    forSaleTokenIdToCollection[totalNumberOfForSaleTokenId] = collection;

    /* next tokenId within the collection is the total number of copies it has */
    totalNumberOfAllCopies[collection] += copies;
    forSaleTokenIdToCollectionTokenId[totalNumberOfForSaleTokenId] =
      totalNumberOfAllCopies[collection];

    totalNumberOfAtworks.push(copies);
    totalNumberOfForSaleTokenId += 1;
  }

  function sellItem(uint256 tokenId) public {
    /* sellItem is called by the collection
     * to update the amount of tokens that are still available */
    require(
      ERC721Collections[ForTheLolzItem(payable(msg.sender))],
      "should only be called by collection");
    require(
      forSaleTokenIdToCollection[tokenId] == ForTheLolzItem(payable(msg.sender)),
      "should be called by correct collection");
    require(available[tokenId] > 0, "there is nothing left");
    available[tokenId] -= 1;
  }

  /* ERC165 */
  function supportsInterface(bytes4 /* interfaceId */)
    public view virtual override(ERC721, ERC721Enumerable) returns (bool) {
    return false;
  }

  /* ERC721, ERC721Enumerable */
  function _beforeTokenTransfer(address from, address to, uint256 tokenId)
    internal virtual override(ERC721, ERC721Enumerable) {
    super._beforeTokenTransfer(from, to, tokenId);
  }

  /* ERC721URIStorage */
  function tokenURI(uint256 tokenId)
    public view virtual override(ERC721, ERC721URIStorage) returns (string memory) {
    return super.tokenURI(tokenId);
  }

  function _burn(uint256 tokenId) internal virtual override(ERC721, ERC721URIStorage) {
    super._burn(tokenId);
    delete tokenPrice[tokenId];
  }
}
